import { Form } from "react-bootstrap";
import styled from "styled-components";
import "./App.css";

const Container = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Title = styled.div`
  text-align: center;
  font-size: 30px;
  font-weight: bold;
  padding-bottom: 30px;
`;

const Wrapper = styled.div`
  margin-top: 30px;
  background-color: #fff;
  width: 550px;
  height: 750px;
  padding: 30px;
  box-sizing: border-box;
  border-radius: 0px;
  border-style: groove;
`;

const TaskNew = styled.div`
  padding-top: 20px;
  text-align: center;
`;

const Name = styled.div`
  margin: 20px;
  color: #969292;
  font-size: 16px;
  text-align: center;
`;

const Desc = styled.div`
  margin: 20px;
  color: #969292;
  font-size: 16px;
  text-align: center;
`;

const NewTask = () => {
  return (
    <Container>
      <Wrapper>
        <Title>Új feladat</Title>
        <Name>
          <label className="Name">Feladat neve</label>
          <textarea className="input" cols="40" type="text" name="fullName" />
        </Name>
        <div>
          <label className="Name">Feladat leírása</label>
        </div>
        <textarea cols="55" rows="6" type="text" name="fullDescription" />

        <Desc>
          <label className="Name">Partner</label>
          <textarea className="input" type="text" name="partner" />
        </Desc>
      </Wrapper>
    </Container>
  );
};

export default NewTask;
